import React from 'react';
import logo from './images/1.jpg';
import './App.css';
import { Card, Navbar, Button, Container } from 'react-bootstrap';

function Main() {
  return (
    <Container>
      <Card variant="card-columns" style={{ width: '18rem' }}>
        <Card.Img variant="top" src={ require('./images/2.gif') } />
        <Card.Body>
          <Card.Title>Gail Kenning</Card.Title>
          <Button variant="primary">View</Button>
        </Card.Body>
      </Card>
      <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src={ require('./images/1.jpg') } />
        <Card.Body>
          <Card.Title>Gail Kenning</Card.Title>
          <Button variant="primary">View</Button>
        </Card.Body>
      </Card>
      <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src={ require('./images/2.gif') } />
        <Card.Body>
          <Card.Title>Gail Kenning</Card.Title>
          <Button variant="primary">View</Button>
        </Card.Body>
      </Card>
    </Container>
  );
}

export default Main;
